-- Removing temporary table and create final VIEW structure
DROP TABLE IF EXISTS "v_fixtures";
CREATE VIEW v_fixtures AS
SELECT 
    t_fixtures.League,
    strftime('%d-%m-%Y', t_fixtures.Match_Date) AS Match_Date,
    t_fixtures.Kick_Off,
    hteam.Team AS Home_Team,
    ateam.Team AS Away_Team,
    hleagues.Rating AS Home_Rank,
    aleagues.Rating AS Away_Rank,
    ABS(hleagues.Rating - aleagues.Rating) AS Rank_Diff,
    ABS(hleagues.Rating - aleagues.Rating) * 5 AS Rank_Diff_Chart,
    FLOOR(((FLOOR(hleagues.G_PG) + FLOOR(hleagues.GA_PG)) + (FLOOR(aleagues.G_PG) + FLOOR(aleagues.GA_PG))) / 2) AS Predicted_Goals,
    FLOOR(((FLOOR(hleagues.SHT_PG) + FLOOR(hleagues.SHTA_PG)) + (FLOOR(aleagues.SHT_PG) + FLOOR(aleagues.SHTA_PG))) / 2) AS Predicted_Shots_On_Target,
    FLOOR(((FLOOR(hleagues.YC_PG) + FLOOR(hleagues.YCA_PG)) + (FLOOR(aleagues.YC_PG) + FLOOR(aleagues.YCA_PG))) / 2) AS Predicted_Cards,
    FLOOR(((FLOOR(hleagues.C_PG) + FLOOR(hleagues.CA_PG)) + (FLOOR(aleagues.C_PG) + FLOOR(aleagues.CA_PG))) / 2) AS Predicted_Corners
FROM 
    t_fixtures
INNER JOIN 
    t_teams hteam ON TRIM(t_fixtures.home_team) = hteam.Alias
INNER JOIN 
    t_teams ateam ON TRIM(t_fixtures.away_team) = ateam.Alias
INNER JOIN 
    v_leagues hleagues ON hteam.Team = hleagues.Team
INNER JOIN 
    v_leagues aleagues ON ateam.Team = aleagues.Team;

