DROP TABLE IF EXISTS "v_leagues";
CREATE VIEW v_leagues as
SELECT t_leagues.League,t_tables.* 
FROM "t_tables"
inner join t_leagues
on t_tables.Div = t_leagues.Div;

-- Removing temporary table and create final VIEW structure
DROP TABLE IF EXISTS "v_new_fixture_teams";
CREATE VIEW v_new_fixture_teams as
select * from 
        (SELECT
        all_teams.League,
        all_teams.team as fixture_team
        FROM
                (
                    SELECT League,Home_team as team 
                    FROM t_fixtures
                    UNION ALL
                    SELECT League,Away_team as team
                    FROM t_fixtures a_teams
                ) all_teams
        GROUP BY all_teams.League,all_teams.team
        ) dist_teams

left join t_teams 
on dist_teams.fixture_team = t_teams.Alias        

where Alias is null;

-- Removing temporary table and create final VIEW structure
DROP TABLE IF EXISTS "v_new_result_teams";
CREATE VIEW v_new_result_teams AS
SELECT
*
from
        (
                SELECT team as results_team 
                FROM t_results
                UNION
                SELECT Opponent as results_team
                FROM t_results
        ) all_teams

left join t_teams 
on all_teams.results_team = t_teams.Alias     

where Alias is null;

